import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from "react";
import axios from 'axios';

import {getRestInformation} from "./components/APIs/YelpAPI";
import {GeoLocation} from "./components/APIs/GeoLocation";

// for matching, iterate through the type of cousine, in the array, and if matching, hold the information of
// other type of food

function App() {
  const [dummy, setDummy] = useState(null)
  // let myLocation = new GeoLocation()
  // let long = myLocation.componentDidMount()

  // Dummy function call to get the closest restaurant from you
  let ans = getRestInformation('610 Beacon Street Boston 02215',[1,2,3,4])
  console.log(ans)
  // ans.forEach(business => console.log(business))

  // let wtf = new GeoLocation()
  // wtf.componentDidMount()
  //useEffect(() => {
  //   setDummy(getRestInformation('NYC',[1,2,3]))
  //   console.log('dummy: ',dummy)
  // }, [])

  const yelpHandler = () => {
    axios.get('https://api.yelp.com/v3/businesses/search', 'New York City', {
    headers: {
      'Content-Type': 'application/json'
    }
    }).then((res) => {
      console.log('response from handler: ', res)
    }).catch((err) => {
      console.log(err)
    })
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p onClick={yelpHandler}>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
